# --- Helper: one-sample power --------------------------------------------
power_one_sample <- function(d, n, alpha = 0.05) {
  stats::power.t.test(
    n = n, delta = d, sd = 1,
    sig.level = alpha, type = "one.sample", alternative = "two.sided"
  )$power
}

