    tags$script(HTML("
(function(){
  document.addEventListener('DOMContentLoaded', function(){
    var shell = document.querySelector('.app-topnav'); if(!shell) return;

    // --- burger toggle (opens/closes the whole menu) ---
    var burger = shell.querySelector('.app-burger');
    if(burger){
      burger.addEventListener('click', function(){
        shell.classList.toggle('open');

        // when closing, also collapse any open dropdowns
        if(!shell.classList.contains('open')){
          shell.querySelectorAll('.app-nav li.dropdown.open')
               .forEach(function(li){ li.classList.remove('open'); });
        }

        if(window.parentIFrame && window.parentIFrame.size){ window.parentIFrame.size(); }
      });
    }

    // --- mobile dropdown toggles (tap on caret/title to open/close) ---
    shell.querySelectorAll('.app-nav li.dropdown > a').forEach(function(anchor){
      anchor.addEventListener('click', function(e){
        if(window.innerWidth <= 860){
          e.preventDefault();                 // don't navigate / jump
          var li = this.parentElement;
          li.classList.toggle('open');        // open/close just this dropdown
          if(window.parentIFrame && window.parentIFrame.size){ window.parentIFrame.size(); }
        }
      });
    });

    // --- close whole menu when clicking a leaf link (not the dropdown trigger) ---
    shell.addEventListener('click', function(e){
      if(e.target.tagName === 'A' && shell.classList.contains('open')){
        // if it's a dropdown trigger on mobile, don't close the whole menu
        var isTrigger = e.target.parentElement && e.target.parentElement.classList.contains('dropdown');
